INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1001, "春咲 ひより", 2, 1.4, 0, 0, 0, 1, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 1, "お！\nあそこに困ってそうな人発見！", 0, 1, "ねぇねぇ、騎士クン\n手伝ってあげようよ～");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1002, "草野 優衣", 2, 1.4, 0, 0, 0, 1, "みんなみたいに\nわたしも強くならなきゃ", 0, 1, "大切な人を\n守れるようになりたい…って", 0, 1, "わ、わたし、\nなに言ってるんだろ\nあはは…");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1003, "士条 怜", 2, 1.4, 0, 0, 0, 1, "フェンシングを始めてみては？", 0, 1, "キミに必要な集中力と感性が", 0, 1, "少しは磨かれると思いますよ。");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1004, "穂高 みそぎ", 2, 1.5, 0, 0, 0, 1, "ねぇ、にいちゃん！", 0, 1, "今日はなにして遊ぶ？", 0, 1, "みそぎはねぇ、\nかくれんぼやりたい！");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1006, "風宮 あかり", 2, 1.4, 0, 0, 0, 1, "風宮あかりです", 0, 1, "ねぇ…", 0, 1, "私といっしょに…\nいかない？");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1007, "出雲 宮子", 2, 1.5, 0, 0, 0, 1, "出雲宮子なのー", 0, 1, "プリンたべたいのー", 0, 1, "食べ物の恨みは怖いのー");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1008, "虹村 雪", 2, 1.4, 0, 0, 0, 1, "ボクは虹村雪。", 0, 1, "キミもボクの美貌に\n吸い寄せられたんだね。", 0, 1, "いいよ。\n見られることは運命さ…");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1009, "柊杏奈", 2, 1.4, 0, 0, 0, 1, "フッ…聞いて後悔するがいい！", 0, 1, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, 1, "人呼んで「疾風の冥姫」!!");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1010, "姫宮 真歩", 2, 1.5, 0, 0, 0, 1, "マホマホ王国のプリンセス、\nまほ姫どす", 0, 1, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, 1, "ほんまおおきにやわ～♪");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1011, "衣之咲 璃乃", 2, 1.4, 0, 0, 0, 1, "衣之咲璃乃です！", 0, 1, "生き別れたお兄ちゃんを探して\n三千世界！", 0, 1, "ここで会ったが\n100年目～！");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1012, "柏崎 初音", 2, 1.4, 0, 0, 0, 1, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 1, "ち、超能力って…\n何のことかな～？", 0, 1, "…って、お願い！\n誰にも言わないでおいて～！");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1016, "美波 鈴奈", 2, 1.4, 0, 0, 0, 1, "ちょす！\n美波鈴奈だよ～♪", 0, 1, "一応カリスマ読モJKやってまっす！", 0, 1, "ヒデサイまぢ\nGF（グッドフィーリング）～♪");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1017, "喜屋武 香織", 2, 1.4, 0, 0, 0, 1, "はいたーい。\n喜屋武香織さー。", 0, 1, "東京は遊園地みたいなところさー", 0, 1, "でも、沖縄もとってもいいとこさー");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1018, "支倉 伊緒", 2, 1.4, 0, 0, 0, 1, "支倉伊緒です。", 0, 1, "先生って呼ばれるのは\nくすぐったいから", 0, 1, "イオちゃんって呼んでね。");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1020, "茜 ミミ", 2, 1.5, 0, 0, 0, 1, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 1, "あ！/\お兄ちゃ～ん\nまってよ～", 0, 1, "ミミをおいてかないでぇ～");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1021, "栗林 くるみ", 2, 1.5, 0, 0, 0, 1, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 1, "あの……\nふぇ……", 0, 1, "ふぇぇぇぇぇん……");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1022, "風宮 より", 2, 1.4, 0, 0, 0, 1, "風宮よりです。\nあああああ！", 0, 1, "こんな私に貴重な時間を\n割いていただき、", 0, 1, "なんてありがとうございます！");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1023, "北条 綾音", 2, 1.5, 0, 0, 0, 1, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 1, "おにいちゃんどこいくの？\nえ？", 0, 1, "私こっち行きたいー\nね、早く早くー");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1025, "天野 すずめ", 2, 1.4, 0, 0, 0, 1, "わっ…わっ…私、\n天野すずめといいます！", 0, 1, "ふ、不束者ですが\nどうぞ末永く…って、", 0, 1, "これて何か違う…\nあああすみません！");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1027, "倉石 恵理子", 2, 1.4, 0, 0, 0, 1, "……クスクス…私は\n…倉石恵理子……", 0, 1, "あなたは…運命の……\n伴侶……", 0, 1, "離しませんわ………\n絶対に…!!");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1028, "佐々木 咲恋", 2, 1.4, 0, 0, 0, 1, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 1, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, 1, "…そうでしょ？？");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1029, "桜井 望", 2, 1.4, 0, 0, 0, 1, "桜井望だよ！\nよろしくねっ", 0, 1, "ぇっと…\nキミ、私のこと知らないの?!", 0, 1, "あはは、\n私もまだまだだなぁ～");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1030, "ニノン・ジュベール", 2, 1.4, 0, 0, 0, 1, "デケデケデンっ！", 0, 1, "初めまして、\n私はニノン・ジュベール申すデス！", 0, 1, "ショーグン、\nワタシと一緒に天下統一デース！");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1031, "上喜 しのぶ", 2, 1.4, 0, 0, 0, 1, "上喜しのぶです。\n手元のドクロが父です。", 0, 1, "でもって私の隣にいるのが……\nえ、見えない？", 0, 1, "おかしいですね……");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1033, "野戸まひる", 2, 1.5, 0, 0, 0, 1, "目指すはビッグな\nお笑い芸人だっぺ！", 0, 1, "けんども\nそれには足りないモンが…", 0, 1, "そう、\nオラのボケに突っ込める相方が…！");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1034, "綾瀬 ゆかり", 2, 1.4, 0, 0, 0, 1, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 1, "ちょっと緊張しちゃって…", 0, 1, "ちょ\nちょっと一杯飲んできます…！");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1036, "氷川 鏡華", 2, 1.5, 0, 0, 0, 1, "氷川鏡華…です", 0, 1, "知らない人とは話しちゃいけないので", 0, 1, "これ以上お話しすることは…\nないです！");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1038, "柏崎 栞", 2, 1.4, 0, 0, 0, 1, "柏崎…栞です。", 0, 1, "……あ、アラーム。", 0, 1, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1040, "双葉 碧", 2, 1.4, 0, 0, 0, 1, "ふ、双葉碧です。", 0, 1, "私、一人も友達がいなくて……", 0, 1, "野に咲く花が、\n唯一の話相手です。");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1042, "三角 千歌", 2, 1.4, 0, 0, 0, 1, "三角千歌です。", 0, 1, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, 1, "そう思っています。");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1043, "安芸 真琴", 2, 1.4, 0, 0, 0, 1, "安芸真琴だ。", 0, 1, "あぁ？\nお前のそいつの仲間か？", 0, 1, "う、疑ってすまなかったな…");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1044, "イリヤ・オーンスタイン", 2, 1.4, 0, 0, 0, 1, "わらわこそは夜を総べる者！", 0, 1, "生けとし生ける全ての者よ！", 0, 1, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1045, "遠見 空花", 2, 1.4, 0, 0, 0, 1, "そこで騎士は妖精を乱暴に……", 0, 1, "ぐふふふふ……はっ！", 0, 1, "ｌク、クウカに何かご用ですか!?");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1046, "宮坂たまき", 2, 1.4, 0, 0, 0, 1, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 1, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, 1, "う～ん…\n猫ってホントに最高にゃ～♪");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1048, "大神 美冬", 2, 1.4, 0, 0, 0, 1, "大神美冬よ！", 0, 1, "それでは早速クエストに…", 0, 1, "…と思ったら\nバイトの時間だ！\nまたあとでね！");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1049, "星野静流", 2, 1.4, 0, 0, 0, 1, "星野静流だよ！", 0, 1, "クエストもバトルも\n掃除も洗濯も", 0, 1, "お姉ちゃんがぜ～んぶ\nやってあげるからね！");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1050, "玉泉美咲", 2, 1.5, 0, 0, 0, 1, "アタシは玉泉美咲。", 0, 1, "見ての通りの\nセクシー美少女で", 0, 1, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1052, "リマ", 2, 1.4, 0, 0, 0, 1, "？？？", 0, 1, "？？？？", 0, 1, "？？？？");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1053, "モニカ・ヴァイスヴィント", 2, 1.5, 0, 0, 0, 1, "モニカ・ヴァイスヴィントだ。", 0, 1, "菓子でつろうなどと\n稚拙な策を……", 0, 1, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1058, "ペコリーヌ", 2, 1.5, 0, 0, 0, 1, "モニカ・ヴァイスヴィントだ。", 0, 1, "菓子でつろうなどと\n稚拙な策を……", 0, 1, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1059, "コッコロ", 2, 1.5, 0, 0, 0, 1, "モニカ・ヴァイスヴィントだ。", 0, 1, "菓子でつろうなどと\n稚拙な策を……", 0, 1, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_1d53671fb2798c45edf0c9be637833d36124051d8f1e1fffcbf364a1d3097681` VALUES (1060, "キャル", 2, 1.5, 0, 0, 0, 1, "モニカ・ヴァイスヴィントだ。", 0, 1, "菓子でつろうなどと\n稚拙な策を……", 0, 1, "そ、そこまでいうなら\nもらってやる");
